// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract WalletManager {
    // Mapping từ địa chỉ ví của người dùng đến số dư của họ
    mapping(address => uint256) public balances;

    // Mapping để lưu trữ ví của người dùng (address ví được cấp cho người dùng)
    mapping(address => address) public userWallets;

    // Sự kiện ghi lại các khoản nạp tiền
    event Deposit(address indexed addressWallet, uint256 amount);

    // Function để cấp địa chỉ ví cho người dùng (chỉ admin có quyền gọi)
    address public admin;
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    constructor() {
        admin = msg.sender;
    }

    function assignWallet(address user, address walletAddress)
        external
        onlyAdmin
    {
        userWallets[user] = walletAddress;
    }

    // Nạp tiền vào địa chỉ ví của người dùng
    receive() external payable {
        balances[msg.sender] += msg.value;
        emit Deposit(msg.sender, msg.value);
    }
}

